window.bookSummaryJSON = "<p><b>Unknown to humans, beyond daylight lies a world of intoxicating darkness where deadly creatures prowl with insatiable desires and unbelievable power: vampires, demons, witches, shifters. When vulnerable humans find themselves thrust into that realm, they’ll never be the same … The 17th installment in the long running fan-favorite Dark Protectors series from </b><i><b>New York Times</b></i><b> bestselling author Rebecca Zanetti</b></p><p> </p><p>In the aftermath of war, a fragile peace hovers between the Kurjan nation and the Dark Protector coalition. Yet amid labyrinthine politics and intrigue, Vero Phoenix, a Kurjan, stands apart. He has lived devoid of legacy or lineage—until the day he backed his newfound brother as king, putting himself into the treacherous position of enforcer and shield. Yet there is another thorn in his side, no less vexing, undeniably captivating—and all-too-human …</p><p> </p><p>Lyrica Graves was once ensnared by Kurjan captors and now embodies defiance and freedom as she guides other women to independence and modernity. She is particularly amused—and breathtakingly challenged—by her battles with Vero. But their clashing also belies a sizzling connection, a dark attraction between supernatural and fully human that threatens their chosen destinies and makes them a target for far too many bloodthirsty enemies …</p>"; 
